import React from "react";
import { UserContext } from "../../Context/UserContext";
import { useContext } from "react";
import { Select } from "antd";

const handleChange = (value: string) => {
  console.log(value);
};

const SelectRick: React.FC = () => {
  const userContext = useContext(UserContext);
  console.log(userContext?.data?.results);
  return (
    <Select
      defaultValue="Status"
      style={{ width: 200 }}
      onChange={handleChange}
      options={[
        {
          label: "Status",
          options: [
            { label: "Alive", value: "alive", key: "status-alive" },
            { label: "Dead", value: "dead", key: "status-dead" },
            { label: "Unknown", value: "unknown", key: "status-unknown" },
          ],
          key: "status-options",
        },
        {
          label: "Gender",
          options: [
            { label: "Male", value: "male", key: "gender-male" },
            { label: "Female", value: "female", key: "gender-female" },
            {
              label: "Genderless",
              value: "genderless",
              key: "Gender-genderless",
            },
            { label: "Unknown", value: "unknown", key: "gender-unknown" },
          ],
          key: "gender-options",
        },
      ]}
    />
  );
};

export default SelectRick;
